      <div className='hexagon'>
        <img alt='laoding' src='https://i.imgur.com/Mw9MgLn.png' />
      </div>
      <div className='main'>
        <p className='abv-iiitm'>ABV-IIITM</p>
        <p className='presents'>presents</p>
        <p className='hackstack'>
          <b>HACK STACK</b>
